        (function fairyDustCursor() {
          
          var possibleColors = ["#f6e200"]
          var width = window.innerWidth;
          var height = window.innerHeight;
          var cursor = {x: width/2, y: width/2};
          var particles = [];
          
          function init() {
            bindEvents();
            loop();
          }
          
          // Bind events that are needed
          function bindEvents() {
           // document.addEventListener('mousemove', onMouseMove);
            document.addEventListener('touchmove', onTouchMove);
            document.addEventListener('touchstart', onTouchMove);
            window.addEventListener('resize', onWindowResize);
            document.addEventListener("mousemove", debounced(10, onMouseMove));
          }
          
          function onWindowResize(e) {
            width = window.innerWidth;
            height = window.innerHeight;
          }
          function debounced(delay, fn) {
          let timerId;
          return function (...args) {
            if (timerId) {
              clearTimeout(timerId);
            }
            timerId = setTimeout(() => {
              fn(...args);
              timerId = null;
            }, delay);
          }
        }
        
          function onTouchMove(e) {
            if( e.touches.length > 0 ) {
              for( var i = 0; i < e.touches.length; i++ ) {
                addParticle( e.touches[i].clientX, e.touches[i].clientY, possibleColors[Math.floor(Math.random()*possibleColors.length)]);
              }
            }
          }
          
          function onMouseMove(e) { 
            cursor.x = e.clientX;
            cursor.y = e.clientY + window.pageYOffset;
            
            addParticle( cursor.x, cursor.y, possibleColors[Math.floor(Math.random()*possibleColors.length)]);
          }
          
          function addParticle(x, y, color) {
            var particle = new Particle();
            particle.init(x, y, color);
            particles.push(particle);
          }
          
          function updateParticles() {
            
            // Updated
            for( var i = 0; i < particles.length; i++ ) {
              particles[i].update();
            }
            
            // Remove dead particles
            for( var i = particles.length -1; i >= 0; i-- ) {
              if( particles[i].lifeSpan < 0 ) {
                particles[i].die();
                particles.splice(i, 1);
              }
            }
          }
          
          function loop() {
            requestAnimationFrame(loop);
            updateParticles();
          }
          
          /**
           * Particles
           */
          
          function Particle() {
        
            this.character = "✦";
            this.lifeSpan = 35; //ms
            this.initialStyles ={
              "position": "absolute",
              "display": "block",
              "pointerEvents": "none",
              "z-index": "10000000",
              "fontSize": "83px",
              "will-change": "transform",
              "opacity": .7
            };
        
            // Init, and set properties
            this.init = function(x, y, color) {
        
              this.velocity = {
                x:  (Math.random() < 0.5 ? -1 : 1) * (Math.random() / 2),
                y: 1
              };
              
              this.position = {x: x - 50, y: y - 50};
              this.initialStyles.color = color;
        
              this.element = document.createElement('span');
              this.element.innerHTML = this.character;
              applyProperties(this.element, this.initialStyles);
              this.update();
              
              document.querySelector('.cursor-container').appendChild(this.element);
            };
            
            this.update = function() {
              this.position.x += this.velocity.x;
              this.position.y += this.velocity.y;
              this.lifeSpan--;
              
              this.element.style.transform = "translate3d(" + this.position.x + "px," + this.position.y + "px, 0) scale(" + (this.lifeSpan / 120) + ")";
            }
            
            this.die = function() {
              this.element.parentNode.removeChild(this.element);
            }
            
          }
          
          /**
           * Utils
           */
          
          // Applies css `properties` to an element.
          function applyProperties( target, properties ) {
            for( var key in properties ) {
              target.style[ key ] = properties[ key ];
            }
          }
          
          init();
        })();